import React, { createRef } from 'react';
import { Button, Modal } from 'react-bootstrap'
import { Link } from 'react-router-dom';
import Homepage from './Homepage';
import FireState from './fireState';
import Login from './Login';
import AddMovie from './addMovie';




class AdminLogin extends React.Component {

    constructor(props)
    {
        super(props)
        this.state={
            show:true
        }
        this.handleModal = this.handleModal.bind(this);
        this.ProfileScreen = this.ProfileScreen.bind(this);
    }


    ProfileScreen(){
        return(
        <div>
            <Link to ='./Homepage.jsx' ></Link>
        </div>
        )
        

    }

    handleModal()
    {
        this.setState({show:!this.state.show})
        
    }
  //  onClick={()=>{this.handleModal()}}
  // onHide={()=>this.handleModal()}
    
    

   render() {
       return ( 
           <div>
           <div>
               <Modal backdrop="static" show={this.state.show}>
                   <Modal.Header closeButton>
                       <div className="header">
                       <p style={{color: "black"}}>This section is for admins only!</p>
                       </div>
                       </Modal.Header>
                   <Modal.Body>
                       <Login modal={this.handleModal}/>
                   </Modal.Body>
                   <Modal.Footer>
                   <button type="submit" onClick={this.ProfileScreen} class="btn btn-primary">back</button>
                   </Modal.Footer>
               </Modal>
               </div>
               <div>
                   <AddMovie></AddMovie>
               </div>
               </div>
           
       )
   }






}
export default AdminLogin;
